import React from "react";
import logo from "./logo.svg";
import title_img from "./images/logo-teamtrees-full-alt.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={title_img} className="App-logo" alt="logo" />
        <p>
          We did it! But that doesn't mean we're done. Come back anytime you
          feel like planting a tree?
        </p>
        <div className="counter">
          <div id="totalTrees" class="counter">
            56
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
